import UserMenu from './UserMenu/UserMenu';
import RegisterForm from './RegisterForm/RegisterForm';
import LoginForm from './LoginForm/LoginForm';

export function App() {
  const { data } = useGetContactsQuery();
  return (
    <>
      <UserAuth></UserAuth>
      <UserMenu></UserMenu>
      <RegisterForm />
    </>
  );
}
